public:
  information_schema:
    data_type_privileges:
      type: view
      view_sql: " SELECT current_database()::information_schema.sql_identifier AS\
        \ object_catalog,\n    objschema AS object_schema,\n    objname AS object_name,\n\
        \    objtype::information_schema.character_data AS object_type,\n    objdtdid\
        \ AS dtd_identifier\n   FROM ( SELECT attributes.udt_schema,\n           \
        \ attributes.udt_name,\n            'USER-DEFINED TYPE'::text AS text,\n \
        \           attributes.dtd_identifier\n           FROM information_schema.attributes\n\
        \        UNION ALL\n         SELECT columns.table_schema,\n            columns.table_name,\n\
        \            'TABLE'::text AS text,\n            columns.dtd_identifier\n\
        \           FROM information_schema.columns\n        UNION ALL\n         SELECT\
        \ domains.domain_schema,\n            domains.domain_name,\n            'DOMAIN'::text\
        \ AS text,\n            domains.dtd_identifier\n           FROM information_schema.domains\n\
        \        UNION ALL\n         SELECT parameters.specific_schema,\n        \
        \    parameters.specific_name,\n            'ROUTINE'::text AS text,\n   \
        \         parameters.dtd_identifier\n           FROM information_schema.parameters\n\
        \        UNION ALL\n         SELECT routines.specific_schema,\n          \
        \  routines.specific_name,\n            'ROUTINE'::text AS text,\n       \
        \     routines.dtd_identifier\n           FROM information_schema.routines)\
        \ x(objschema, objname, objtype, objdtdid);"
      schema:
        object_catalog: varchar(64)
        object_schema: varchar(64)
        object_name: varchar(64)
        object_type: varchar(256)
        dtd_identifier: varchar(64)
      pg_types:
        object_catalog: name
        object_schema: name
        object_name: name
        object_type: varchar
        dtd_identifier: name
